<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title></title>

    <link rel="stylesheet" href="https://cdn.jsdelivr.net/gh/eudiegoborgs/natural-swagger-php/src/Resources/assets/swagger-ui.css" type="text/css" />
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/gh/eudiegoborgs/natural-swagger-php/src/Resources/assets/style.css" />
    <link rel="icon" type="image/png" href="https://cdn.jsdelivr.net/gh/eudiegoborgs/natural-swagger-php/src/Resources/assets/favicon-32x32.png" sizes="32x32" />
    <link rel="icon" type="image/png" href="https://cdn.jsdelivr.net/gh/eudiegoborgs/natural-swagger-php/src/Resources/assets/favicon-16x16.png" sizes="16x16" />
    <style>
        html
        {
            box-sizing: border-box;
            overflow: -moz-scrollbars-vertical;
            overflow-y: scroll;
        }

        *,
        *:before,
        *:after
        {
            box-sizing: inherit;
        }

        body
        {
            margin:0;
            background: #fafafa;
        }
    </style>
</head>

<body>
    <div id="swagger-ui" class="api-platform"></div>

    <script src="https://cdn.jsdelivr.net/gh/eudiegoborgs/natural-swagger-php/src/Resources/assets/swagger-ui/swagger-ui-bundle.js"></script>
    <script src="https://cdn.jsdelivr.net/gh/eudiegoborgs/natural-swagger-php/src/Resources/assets/swagger-ui/swagger-ui-standalone-preset.js"></script>
    <script src="https://cdn.jsdelivr.net/gh/eudiegoborgs/natural-swagger-php/src/Resources/assets/init-swagger-ui.js"></script>
    <script type="text/javascript">
        (function () {
            var swaggerUI = null;
            window.onload = loadSwaggerUI(swaggerUI);
        })();
    </script>
</body>
</html>
